import { Provider } from 'react-redux';
import React from 'react';
import store from '../redux/store'

export default function MyApp(props) {
  const { Component, pageProps } = this.props;
  return (
    <Provider store={store}>
      <Component {...pageProps} />
    </Provider>
  );
};
